package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import java.io.Serializable;import java.util.Date;/** * @Address * @地址(address) * @version : Ver 1.0 */@TableName("channel_record")public class ChannelRecord implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long channelId;	private Date loginTime;	private String loginIp;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public Long getChannelId() {		return channelId;	}	public void setChannelId(Long channelId) {		this.channelId = channelId;	}	public Date getLoginTime() {		return loginTime;	}	public void setLoginTime(Date loginTime) {		this.loginTime = loginTime;	}	public String getLoginIp() {		return loginIp;	}	public void setLoginIp(String loginIp) {		this.loginIp = loginIp;	}	@Override	public String toString() {		return "ChannelRecord{" +				"id=" + id +				", channelId=" + channelId +				", loginTime=" + loginTime +				", loginIp='" + loginIp + '\'' +				'}';	}}